import classes from "./ForSale.module.css";
import products from "./Products";

let ForSale = () => {
  const theProducts = products.map((product) => (
    <div class={classes.card}>
      <div class={classes.images}>
        <h2 class="product-name">{product.name}</h2>
        <img
          class={classes.large_photo}
          src={product.img_url1}
          alt={product.name}
        ></img>
      </div>
      <div className="small-photo">
        <img
          class={classes.product_sm}
          src={product.img_url2}
          alt={product.name}
        />
        <img
          class={classes.product_sm}
          src={product.img_url3}
          alt={product.name}
        />
        <img
          class={classes.product_sm}
          src={product.img_url4}
          alt={product.name}
        />
      </div>
      <div class={classes.text}>
        <h3 class="price">{product.price}</h3>
        <h4 class="used">{product.used}</h4>
        <h4 class="description">${product.description}</h4>
      </div>
      <div class={classes.email}>
        <h4>
          <a href="mailto:jogucareers@gmail.com">email me about this product</a>
        </h4>
      </div>
    </div>
  ));
  return theProducts;
};

export default ForSale;
